import React from "react";
import ReactDom from "react-dom";
const friends=['Mubashir', 'Mazher','Tanzeel' ];
var[a,b,c]=friends;
ReactDom.render(
    <>
    {document.write(`My first friend is ${a} and second friend ids${c}`)}
    </>
    ,document.getElementById("root")
)
